import React from "react";
import "./Frame3640.css";

function Frame3640(props) {
  const { activeOrders, finishedOrders, className } = props;

  return (
    <div className={`frame-3640 ${className || ""}`}>
      <div className="frame-2916 border-1px-quarter-spanish-white">
        <div className="active-orders">{activeOrders}</div>
      </div>
      <div className="frame-3553 border-1px-abbey">
        <div className="finished-orders ibmplexsans-semi-bold-quarter-spanish-white-16px">{finishedOrders}</div>
      </div>
    </div>
  );
}

export default Frame3640;
